import React, { useState, useEffect } from 'react';
import 'bootstrap';

import List from 'components/List';

function App() {
  const URL = 'http://localhost:1337/articles'
  const options = {
    method: 'GET',
    headers: { 'Content-Type': 'application/json' }
  }
  const [listArticles, setListArticles] = React.useState([])

  // useEffect(
  //   () => {
  //     articlesList()
  //   }, []
  // )
  //allArticles()

  const dataArticles = () => {
    fetch(URL, options)
      .then(response => response.json())
      .then(data => console.log('data => ', data))
      .then(data => setListArticles(data))
      .then(data => console.log('listArticles => ', listArticles))
  }

  const allArticles = () => {
    listArticles.map(item => {
      <List key={item.id} itemArticle={item} />
    })
  }

  return (
    <div className="App">
      <div className="container">
        <article>
          <ul>
            {
              allArticles()}
          </ul>
        </article>
      </div>
    </div>
  );
}

export default App;
